contract swap {
     address private constant UNISWAP_V2_ROUTER = 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f;
     address private constant WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;

     function tooswap()external{
              address tokenin=0x6B175474E89094C44Da98b954EedeAC495271d0F ;
              uint256 num1=1000000000000000000;
              require(IERC20(tokenin).transferFrom(msg.sender,address(this),num1),"transfer false");
              require(IERC20(tokenin).approve(UNISWAP_V2_ROUTER,num1),"appproval failed");


              address[] memory path = new address[](2);
              path[0]=0x6B175474E89094C44Da98b954EedeAC495271d0F;
              path[1]=0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;

              IUniswapV2Router(UNISWAP_V2_ROUTER).swapExactTokensForETH(num1,0,path,msg.sender,block.timestamp+200);
     }
    }//Gettiing revert while running this any idea what going wrong????

