@Julian Rodriguez popsickle and charm finance are V3 liquidity managment platform that uses ERC20 tokens to represent shares.
Popsickle just got hacked tho üòÑ
The issue is that you need to force the same strategy accross all stakers to create a fair ERC20 token which kinda defeat the purpose of V3 (there cases where it's fine, but in yours doesn't seems like it).

@Julian Rodriguez Honnestly even if I can only have one NFT per vault I don't care I'll likely use your platform.
I can create seperated vault for my USDT / WETH and WBTC / WETH position it's not the end of the world üôÇ
But having 2 or 3 NFTs will leave gas costs likely fine (if you require liquidators to take all or nothing to avoid quadratic gas costs) and allows for bit more complex strategies.

@Julian Rodriguez Ah also this make impossible (or really really hard and costy) to have different strategies of your protocol depending of the total colletaralisation ratio.
Example Liquidity has a mode where if the total collateralisation ratio falls under 150% people that were above the 110% they set are liquidatable anyway (so for example you are at 120% it's fine, but the total is 140% so you gets liquidated anyway).
That wouldn't be possible because you would need to update the NFT price of everyone to calculate the total (I guess you could make that better by keeping tracks of ticks on the liquidity range like the uniswap pool does, that would change the scalling on the number of ticks crossed +1 since the last actuallisation of the pool, instead of the number of NFTs, but you would need to implement the same calculations as uniswap V3 in your protocol to do that, plus if lots of ticks get crossed that still lots of calculations).

